    return (
        <div className="bg-gray-900 w-[350px] h-[500px] max-h-[500px] rounded-md flex flex-col">
            {/* Column title */}
            <div className="bg-black text-md h-[60px] cursor-grab rounded-md rounded-b-none">
                {column.title}
            </div>
            {/* Column task container */}
            <div className="flex flex-grow">
                content
            </div>
            {/* Column footer */}
            <div>Footer</div>
        </div>
    );
}
